import { GET_DOCUMENTS, GET_DOCUMENT } from "../actions/type";
const initialState = {
  projects: [],
  project: {}
};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_DOCUMENTS:
      return {
        ...state,
        projects: action.payload
      };
    case GET_DOCUMENT:
      return {
        ...state,
        project: action.payload
      };

    default:
      return state;
  }
}
